        "  setup_sim(simulated_time=1000, userplace=[devs[k0]], others_info=[0], seed=seed)\n",
        "  print(\"\\n--- %s seconds ---\" % (time.time() - start_time))\n",
        "\n",
        "  ### Finally, you can analyse the results:\n",
        "  print \"-\" * 40\n",
